import React from 'react';
import './header.css';
import {Row,Col,Container} from 'react-bootstrap';
import Button from 'react-bootstrap/Button';

const Header =()=>{
    return(
        <Container className="headerCont ">
            <Row>
                
                <Col className=".d-sm-none .d-md-block"><Row className="header"><h1>About ME</h1></Row>
                </Col>
                <Col><Row className="header"><h1>About ME</h1></Row>
                </Col>
                <Col className=".d-sm-none .d-md-block"><Row className="header"><h1>About ME</h1></Row>
                </Col>
                <Col className=".d-sm-none .d-md-block"><Row className="header"><h1>About ME</h1></Row>
                </Col>
                <Col className=".d-sm-none .d-md-block"><Row className="header"><h1>About ME</h1></Row>
                </Col>
                <Col className=".d-sm-none .d-md-block"><Row className="header"><h1>About ME</h1></Row>
                </Col>
                <Col className="d-sm-none .d-md-block"> <Row className="header"><h1>About ME</h1></Row>
                </Col>
            </Row>
    </Container>
    );
}
export default Header;
